INSERT INTO `co_chapter` VALUES (1, '<br />	掌握Yy-Z02模型机仿真软件的使用方法；<br />\r\n	基于Yy-Z02模型机仿真软件，模拟单重可屏蔽硬中断触发，按步骤操作，运行预设的主程序，随机触发中断，体验中断全过程；<br />\r\n在体验中断过程中，<br />\r\n	理解中断向量与中断服务程序之间的关系；<br />\r\n	理解断点地址和中断返回之间的关系；<br />\r\n	掌握设置中断向量、调用中断服务程序及实现中断返回的方法。<br />\r\n', NULL, '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa41/1_1\\u5b9e\\u9a8c\\u6b65\\u9aa41_\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u74061.mp4\", \"title\": \"\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u74061\"}, {\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa41/1_2\\u5b9e\\u9a8c\\u6b65\\u9aa41_\\u5b9e\\u9a8c\\u539f\\u74062_\\u5b9e\\u9a8c\\u8981\\u6c42_\\u601d\\u8003\\u63a2\\u7d22.mp4\", \"title\": \"\\u5b9e\\u9a8c\\u539f\\u74062_\\u5b9e\\u9a8c\\u8981\\u6c42_\\u601d\\u8003\\u63a2\\u7d22\"}]', 'chapters/pdf/实验步骤1PDF.pdf', NULL, NULL, 1, 1, '预备知识1');
INSERT INTO `co_chapter` VALUES (2, '<br />\r\n	基于Yy-Z02模型机仿真软件，运行预设的主程序调用子程序，实现子程序返回；<br />\r\n在体验子程序调用的过程中，<br />\r\n	对比了解相对寻址和其他寻址方式，分析在跳转指令中的应用；<br />\r\n	分析CALL和RET指令执行，对比中断触发和中断返回指令IRET的执行；<br />\r\n	观察堆栈指针SP和堆栈内容的变化。<br />\r\n从而理解子程序调用与中断之间的区别。<br />', NULL, '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa42/2_1\\u5b9e\\u9a8c\\u6b65\\u9aa42_\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u74061.mp4\", \"title\": \"\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u74061\"}, {\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa42/2_2\\u5b9e\\u9a8c\\u6b65\\u9aa42_\\u5b9e\\u9a8c\\u539f\\u74062.mp4\", \"title\": \"\\u5b9e\\u9a8c\\u539f\\u74062\"}, {\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa42/2_3\\u5b9e\\u9a8c\\u6b65\\u9aa42_\\u5b9e\\u9a8c\\u539f\\u74063.mp4\", \"title\": \r\n\"\\u5b9e\\u9a8c\\u539f\\u74063\"}, {\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa42/2_4\\u5b9e\\u9a8c\\u6b65\\u9aa42_\\u5b9e\\u9a8c\\u539f\\u74064.mp4\", \"title\": \"\\u5b9e\\u9a8c\\u539f\\u74064\"}, {\"path\": \"chapters/video/实验步骤2/2_5实验步骤2_实验原理5_实验步骤_思考与探索.mp4\", \"title\": \"实验原理5_实验步骤_思考与探索\"}]', 'chapters/pdf/实验步骤2PDF.pdf', NULL, NULL, 1, 2, '预备知识2');
INSERT INTO `co_chapter` VALUES (3, '<br />\r\n	基于Yy-Z02模型机仿真软件，将子程序搬迁到另一段内存空间中，并对主程序和子程序中的指令做出相应调整，使得子程序内存重定位后，仍然能够正常执行主程序对子程序的调用和子程序返回；<br />\r\n在子程序内存重定位的过程中，<br />\r\n	深入理解子程序入口地址、相对寻址方式、绝对地址、标号等概念；<br />\r\n	深入理解相对寻址和其他寻址方式，分析在跳转指令中的应用；<br />\r\n	分析CALL和RET指令的机器码及执行，与子程序内存重定位的关系；<br />\r\n	观察堆栈指针SP和堆栈内容的变化。<br />', NULL, '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa43/3_1\\u5b9e\\u9a8c\\u6b65\\u9aa43_\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u7406.mp4\", \"title\": \"\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u7406\"}, {\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa43/3_2\\u5b9e\\u9a8c\\u6b65\\u9aa43_\\u5b9e\\u9a8c\\u8981\\u6c42_\\u5b9e\\u9a8c\\u6b65\\u9aa4_\\u601d\\u8003\\u63a2\\u7d22.mp4\", \"title\": \r\n\"\\u5b9e\\u9a8c\\u8981\\u6c42_\\u5b9e\\u9a8c\\u6b65\\u9aa4_\\u601d\\u8003\\u63a2\\u7d22\"}]', 'chapters/pdf/实验步骤3PDF.pdf', NULL, NULL, 1, 3, '预备知识3');
INSERT INTO `co_chapter` VALUES (4, '<br />\r\n	基于Yy-Z02模型机仿真软件，将预设的中断服务程序搬迁到另一段内存空间中，并对中断向量等做出相应调整，使得中断服务程序内存重定位后，仍然能够正常执行主程序，正常实现中断全过程；<br />\r\n在中断服务程序内存重定位的过程中，<br />\r\n	分析怎样设置中断向量？<br />\r\n	分析开或关中断时，中断触发有否变化？<br />\r\n	观察堆栈指针SP和堆栈内容的变化；<br />\r\n	对比子程序内存重定位，深入理解中断向量、子程序入口地址、相对寻址方式、绝对地址等概念，深入理解中断与子程序调用的区别。<br />', NULL, '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa44/\\u5b9e\\u9a8c\\u6b65\\u9aa44.mp4\", \"title\": \"预备知识4\"}]', 'chapters/pdf/实验步骤4PDF.pdf', NULL, NULL, 1, 4, '预备知识4');
INSERT INTO `co_chapter` VALUES (5, '<br />\r\n	对照Yy-Z02模型机系统中的单重可屏蔽硬中断控制电路，掌握 ARMv7系统的irq中断控制电路结构设计方法；<br />\r\n	实现ARMv7系统的irq中断控制电路模块。<br />', '<br />\r\n	收看视频、观看ARMv7系统的irq中断控制电路结构动画，理解其原理；<br />\r\n	对照Yy-Z02模型机系统中的单重可屏蔽硬中断控制电路，阅读预设代码，理解并修改它，实现ARMv7系统的irq中断控制电路结构设计；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	将irq中断控制电路代码加入预设工程中，生成.bit文件；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa46/6_2\\u5b9e\\u9a8c\\u6b65\\u9aa46_\\u5b9e\\u9a8c\\u76ee\\u7684_\\u5b9e\\u9a8c\\u539f\\u74062.mp4\", \"title\": \"irq中断控制电路设计\"}]', 'chapters/pdf/实验步骤6PDF.pdf', NULL, NULL, 2, 5, 'irq中断控制电路设计');
INSERT INTO `co_chapter` VALUES (6, '<br />\r\n	理解双堆栈指针结构，掌握设计双堆栈指针结构的方法；<br />\r\n	实现ARMv7系统的双堆栈指针结构模块。<br />', '<br />\r\n	收看视频、观看双堆栈指针结构动画，理解其原理；<br />\r\n	阅读预设程序，理解并修改它，实现双堆栈指针结构设计；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	将irq中断控制电路代码加入预设工程中，生成.bit文件；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa47/双堆栈指针结构设计.mp4\", \"title\": \"双堆栈指针结构设计\"}]', 'chapters/pdf/实验步骤7PDF.pdf', NULL, NULL, 2, 6, '双堆栈指针结构设计');
INSERT INTO `co_chapter` VALUES (7, '<br />\r\n	理解系统增加中断机制，对程序状态寄存器堆结构和通用寄存器堆结构带来的改变；<br />\r\n	修改已有的程序状态寄存器堆模块结构和通用寄存器堆模块结构。<br />', '<br />\r\n	收看视频、观看寄存器堆结构动画，理解其原理；<br />\r\n	阅读预设程序，理解并修改它，实现对程序状态寄存器堆结构和通用寄存器堆结构的修改；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa48/修改寄存器堆结构.mp4\", \"title\": \"修改寄存器堆结构\"}]', 'chapters/pdf/实验步骤8PDF.pdf', NULL, NULL, 2, 7, '修改寄存器堆结构');
INSERT INTO `co_chapter` VALUES (8, '<br />\r\n	掌握 ARM系统实现中断返回的方法，掌握中断返回指令的设计原则；<br />\r\n	实现 MOVS中断返回指令。<br />', '<br />\r\n	收看视频、观看中断返回指令MOVS在每个clk周期的动画，理解MOVS指令的执行过程；<br />\r\n	在ARMv7虚拟仿真软件的内存窗口，输入MOVS PC,LR指令的二进制编码，然后在主界面上手动控制发出控制信号，执行MOVS PC,LR指令。<br />\r\n	阅读预设程序，理解并修改它，用三段式有限状态机编程方式实现MOVS指令功能；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa49/9_2\\u5b9e\\u9a8c\\u6b65\\u9aa49_\\u5b9e\\u9a8c\\u539f\\u74062.mp4\", \"title\": \"中断返回指令设计\"}]', 'chapters/pdf/实验步骤9PDF.pdf', NULL, NULL, 2, 8, '中断返回指令设计');
INSERT INTO `co_chapter` VALUES (9, '<br />\r\n	掌握ARM 模型机系统中 irq 中断处理流程；<br />\r\n	实现irq 中断处理隐指令。<br />', '<br />\r\n	收看视频、观看irq 中断处理隐指令4个过程的动画，理解中断处理隐指令的功能、触发条件和执行过程；<br />\r\n	阅读预设程序，理解并修改它，用三段式有限状态机编程方式实现irq 中断处理隐指令功能；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa410/irq中断处理过程.mp4\", \"title\": \"irq中断处理过程\"}]  ', 'chapters/pdf/实验步骤10PDF.pdf', NULL, NULL, 2, 9, 'irq中断处理过程');
INSERT INTO `co_chapter` VALUES (10, '<br />\r\n	理解主程序和irq中断服务程序2的功能；<br />\r\n	组装步骤2~10完成的软件模块和硬件模块，或组装本步骤提供的预设模块，以主程序和irq中断服务程序2为测试程序，进行系统调试，实现一个能处理单重中断的ARMv7系统。<br />', '<br />\r\n	收看视频，理解主程序和irq中断服务程序2的功能；<br />\r\n	适当修改预设参数，在ARMv7虚拟仿真软件上执行，根据错误提示进行修改，直到执行完全正确；<br />\r\n	在预设工程基础上，将学生在步骤2～8实现的部件进行集成，或集成本步骤提供的预设模块；<br />\r\n	将修改好的参数以coe文件形式载入系统的指令存储器ROM和数据存储器RAM中；<br />\r\n	结合学生在步骤5、10中实现的中断返回指令和中断隐指令进行联调，或用本实验给出的预设模块进行联调，构建完整的irq中断全过程，实现一个能处理单重中断的ARMv7系统；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa411/irq中断测试程序及系统集成测试.mp4\", \"title\": \"irq中断测试程序及系统集成测试\"}]', 'chapters/pdf/实验步骤11PDF.pdf', NULL, NULL, 2, 10, '组装单中断源系统及系统调试');
INSERT INTO `co_chapter` VALUES (11, '<br />\r\n	在理解中断优先级概念的基础上，掌握硬件中断抢占控制的数据通路设计方法；<br />\r\n	在学生在步骤2实现的代码基础上进行修改，或对本步骤预设的irq中断控制电路进行修改，实现 irq和fiq 中断控制电路，实现 fiq 对 irq 的高优先级抢占。<br />', '<br />\r\n	收看视频、观看ARMv7系统中断抢占控制电路动画，理解其原理；<br />\r\n	阅读预设程序，理解并修改它，或调出学生在步骤2实现的代码，实现ARMv7系统中断抢占控制电路结构设计；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa412/具有判优功能的中断控制电路.mp4\", \"title\": \"具有判优功能的中断控制电路\"}]', 'chapters/pdf/实验步骤12PDF.pdf', NULL, NULL, 2, 11, '设计具有判优功能的中断控制电路');
INSERT INTO `co_chapter` VALUES (12, '<br />\r\n	掌握ARM 模型机系统中 fiq中断处理流程；<br />\r\n	在步骤6实现的工程基础上，或本步骤给出的预设模块进行修改，编程实现 fiq和irq并存时的中断隐指令。<br />', '<br />\r\n	收看视频、观看多中断源条件下中断处理隐指令4个过程的动画，理解多中断源情况下，隐指令中的判优处理；<br />\r\n	阅读预设程序，理解并修改它，或调出学生在步骤6实现的代码，用三段式有限状态机编程方式实现fiq和irq并存时的中断处理隐指令功能；<br />\r\n	在Verilog HDL程序自动判题系统上运行代码，根据错误提示，修改调试直到正确；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa413/修改中断隐指令.mp4\", \"title\": \"修改中断隐指令\"}] ', 'chapters/pdf/实验步骤13PDF.pdf', NULL, NULL, 2, 12, '修改中断隐指令');
INSERT INTO `co_chapter` VALUES (13, '<br />\r\n	理解主程序、irq中断服务程序、fiq中断服务程序的内存地址分配、两个中断向量之间的关系；<br />\r\n	在步骤7基础上，集成新修改的模块，以主程序和irq、 fiq两个中断服务程序为测试程序，构建完整的fiq对irq中断抢占全过程，实现一个具有中断优先级的ARMv7系统。<br />', '<br />\r\n	收看视频，理解原理；<br />\r\n	适当修改预设参数，在ARMv7虚拟仿真软件上执行，根据错误提示进行修改，直到执行完全正确。<br />\r\n	集成本步骤提供的预设模块，或在预设工程基础上将学生在步骤8实现的部件进行集成。对于后者允许自行修改fiq中断服务程序内容为用MOVS指令实现中断返回；<br />\r\n	将修改好的参数以coe文件形式载入系统的指令存储器ROM和数据存储器RAM中；<br />\r\n	结合学生在步骤9中实现中断隐指令进行联调，或用本实验给出的预设模块进行联调，构建完整的fiq对irq中断抢占全过程，实现一个具有中断优先级的ARMv7系统；<br />\r\n	在远程FPGA设备上完成板级调试。<br />', '[{\"path\": \"chapters/video/\\u5b9e\\u9a8c\\u6b65\\u9aa414/中断抢占测试程序.mp4\", \"title\": \"中断抢占测试程序\"}]', 'chapters/pdf/实验步骤14PDF.pdf', NULL, NULL, 2, 13, '组装多中断源系统及系统调试');
