INSERT INTO `co_test_problem` VALUES (1, 1, '当输入测试数据A=0FFFFH，B=1H时，该组数据相加产生什么结果？', '{\"A\":\"0000\",\"B\":\"1,0000\",\"C\":\"1,0FFFH\",\"D\":\"0FFFFH\"}', 'A');
INSERT INTO `co_test_problem` VALUES (2, 1, '测试数据A=0FFFFH，B=1H，加法运算时，当A、B被看作无符号数和A、B被看成有符号数，这两种情况下运算器硬件操作上有区别吗？', '{\"A\":\"有\",\"B\":\"无\",\"C\":\"\",\"D\":\"\"}', 'B');
INSERT INTO `co_test_problem` VALUES (3, 1, '测试数据A=0FFFFH，B=1H，加法运算时，标志位NZCV的值分别是多少？', '{\"A\":\"1100\",\"B\":\"0111\",\"C\":\"0110\",\"D\":\"0101\"}', 'C');
INSERT INTO `co_test_problem` VALUES (4, 1, '测试数据A=0FFFFH，B=1H，加法运算时，当A、B被看作无符号数，本次运算？', '{\"A\":\"溢出\",\"B\":\"不溢出\",\"C\":\"\",\"D\":\"\"}', 'A');
INSERT INTO `co_test_problem` VALUES (5, 1, '测试数据A=0FFFFH，B=1H，加法运算时，当A、B被看作有符号数，本次运算？', '{\"A\":\"溢出\",\"B\":\"不溢出\",\"C\":\"\",\"D\":\"\"}', 'B');
INSERT INTO `co_test_problem` VALUES (6, 1, '当ALU的运算为F=A，即ALU不运算，作为A操作数的通路时，标志位VF(OF)的值应该是多少？', '{\"A\":\"A31⊕B31⊕F31⊕C32\",\"B\":\"不定\",\"C\":\"\",\"D\":\"\"}', 'B');
INSERT INTO `co_test_problem` VALUES (7, 1, '在带桶形移位器的ALU模块中，当ALU的运算为F=A，即ALU不运算，作为A操作数的通路时，模块输出标志位VF(OF)的值应该是多少？', '{\"A\":\"A31⊕B31⊕F31⊕C32\",\"B\":\"不定\",\"C\":\"CPSR中VF的值\",\"D\":\"\"}', 'C');
INSERT INTO `co_test_problem` VALUES (8, 2, '桶形移位器输出的Shift_carry_out与桶形移位器+ALU模块整体输出的CF标志位之间存在什么关系？', '{\"A\":\"模块输出的CF就是Shift_carry_out\",\"B\":\"逻辑运算时，模块输出的CF就是Shift_carry_out\",\"C\":\"模块输出的CF总是ALU运算产生的CF标志位\",\"D\":\"算术运算时，模块输出的CF是ALU运算产生的CF标志位\"}', 'BD');
INSERT INTO `co_test_problem` VALUES (9, 2, 'CPSR寄存器提供的VF标志位与ALU输出的VF标志位之间存在什么关系？', '{\"A\":\"没有关系\",\"B\":\"ALU输出的VF标志位是引自CPSR的VF\",\"C\":\"ALU输入引自CPSR的VF，如果逻辑运算，以来自CPSR的VF作为ALU输出的VF标志位\",\"D\":\"ALU输入引自CPSR的VF，如果算术运算，用ALU运算生成的VF作为ALU输出的VF标志位\"}', 'CD');
INSERT INTO `co_test_problem` VALUES (10, 1, '对于数据选择器,选择信号位数和被选择数据的数量之间存在什么关系？', '{\"A\":\"没有关系\",\"B\":\"n:2n的关系\",\"C\":\"2n:n的关系\",\"D\":\"\"}', 'B');
INSERT INTO `co_test_problem` VALUES (11, 1, '读寄存器操作需不需要时钟？', '{\"A\":\"读操作的时钟在clk上升沿\",\"B\":\"不需要时钟\",\"C\":\"读操作的时钟在clk下跳沿\",\"D\":\"\"}', 'B');
INSERT INTO `co_test_problem` VALUES (12, 1, '为什么寄存器的写操作要引入系统时钟CLK的下降沿？', '{\"A\":\"下跳沿时当前clk周期的动作都已经完成，是写入结果最合适的时机\",\"B\":\"写操作的时钟不在clk下跳沿，而是上升沿\",\"C\":\"写操作不需要时钟\",\"D\":\"写操作在clk高电平期间完成\"}', 'A');
INSERT INTO `co_test_problem` VALUES (13, 2, '程序状态寄存器堆的设计上，哪些类似通用寄存器？', '{\"A\":\"寄存器宽度一样\",\"B\":\"没有相似之处\",\"C\":\"它们都是边沿型D触发器构成的寄存器\",\"D\":\"写操作都发生在clk下跳沿\"}', 'ACD');
INSERT INTO `co_test_problem` VALUES (14, 1, '当前程序状态寄存器CPSR和备份程序状态寄存器在写入的时候应怎样选择写入的数据？', '{\"A\":\"无法选择\",\"B\":\"在数据输入端添加译码器\",\"C\":\"在数据输出端添加多路选择器\",\"D\":\"在数据输入端添加多路选择器\"}', 'D');
INSERT INTO `co_test_problem` VALUES (15, 2, '程序状态寄存器堆模块在与多功能ALU、桶形移位器、ARM通用寄存器堆连接时应分别注意什么？', '{\"A\":\"将桶形移位器的移位输出数据，连接到通用寄存器的写入数据\",\"B\":\"将桶形移位器的移位输出数据，连接到ALU的A操作数\",\"C\":\"将桶形移位器的移位输出数据，连接到ALU的B操作数\",\"D\":\"将ALU的标志位输出NZCF，连接到CPSR的高4位\"}', 'CD');
INSERT INTO `co_test_problem` VALUES (16, 1, 'ARM V7 有几种工作模式？', '{\"A\":\"7\",\"B\":\"8\",\"C\":\"9\",\"D\":\"10\"}', 'C');
INSERT INTO `co_test_problem` VALUES (17, 1, 'ARM V7 每条指令都可以条件执行', '{\"A\":\"对\",\"B\":\"错\",\"C\":\"\",\"D\":\"\"}', 'A');
INSERT INTO `co_test_problem` VALUES (18, 1, '指令高4位条件码为0011时，指令执行条件是“无符号数小于”，对应的条件是：', '{\"A\":\"NF=0\",\"B\":\"ZF=0\",\"C\":\"CF=0\",\"D\":\"VF=0\"}', 'C');
INSERT INTO `co_test_problem` VALUES (19, 1, '指令高4位条件码为0010时，指令执行条件是“无符号数大于或等于”，对应的条件是：', '{\"A\":\"NF=1\",\"B\":\"ZF=1\",\"C\":\"CF=1\",\"D\":\"VF=1\"}', 'C');
INSERT INTO `co_test_problem` VALUES (20, 1, '指令高4位条件码为0000时，指令执行条件是“相等”，对应的条件是：', '{\"A\":\"NF=1\",\"B\":\"ZF=1\",\"C\":\"CF=1\",\"D\":\"VF=1\"}', 'B');
INSERT INTO `co_test_problem` VALUES (21, 1, '指令高4位条件码为0001时，指令执行条件是“不相等”，对应的条件是：', '{\"A\":\"NF=0\",\"B\":\"ZF=0\",\"C\":\"CF=0\",\"D\":\"VF=0\"}', 'B');
INSERT INTO `co_test_problem` VALUES (22, 1, '指令高4位条件码为1000时，指令执行条件是“无符号数大于”，对应的条件是：', '{\"A\":\"CF=0 or ZF=1\",\"B\":\"ZF=0\",\"C\":\"CF=1\",\"D\":\"CF=1 and ZF=0\"}', 'D');
INSERT INTO `co_test_problem` VALUES (23, 1, '指令高4位条件码为1001时，指令执行条件是“无符号数小于或等于”，对应的条件是：', '{\"A\":\"CF=0 or ZF=1\",\"B\":\"ZF=0\",\"C\":\"CF=1\",\"D\":\"CF=1 and ZF=0\"}', 'A');
INSERT INTO `co_test_problem` VALUES (24, 1, '指令高4位条件码为1010时，指令执行条件是“有符号数大于或等于”，对应的条件是：', '{\"A\":\"NF=VF\",\"B\":\"NF≠VF\",\"C\":\"Z=0 and N=V\",\"D\":\"Z=1 or N≠V\"}', 'A');
INSERT INTO `co_test_problem` VALUES (25, 1, '指令高4位条件码为1011时，指令执行条件是“有符号数小于”，对应的条件是：', '{\"A\":\"NF=VF\",\"B\":\"NF≠VF\",\"C\":\"Z=0 and N=V\",\"D\":\"Z=1 or N≠V\"}', 'B');
INSERT INTO `co_test_problem` VALUES (26, 1, '指令高4位条件码为1100时，指令执行条件是“有符号数大于”，对应的条件是：', '{\"A\":\"NF=VF\",\"B\":\"NF≠VF\",\"C\":\"Z=0 and N=V\",\"D\":\"Z=1 or N≠V\"}', 'C');
INSERT INTO `co_test_problem` VALUES (27, 1, '指令高4位条件码为1101时，指令执行条件是“有符号数小于或等于”，对应的条件是：', '{\"A\":\"NF=VF\",\"B\":\"NF≠VF\",\"C\":\"Z=0 and N=V\",\"D\":\"Z=1 or N≠V\"}', 'D');
INSERT INTO `co_test_problem` VALUES (28, 1, '指令高4位条件码为0100时，指令执行条件是“运算结果为负数”，对应的条件是：', '{\"A\":\"NF=1\",\"B\":\"NF=0\",\"C\":\"VF=1\",\"D\":\"VF=0\"}', 'A');
