INSERT INTO `co_test_problem` VALUES (253, 2, '以下哪些是硬中断（或称外中断）？', '{\"A\":\"指令中断\",\"B\":\"输入输出请求\",\"C\":\"电源故障\",\"D\":\"计时器\"}', 'BCD');
INSERT INTO `co_test_problem` VALUES (254, 2, '以下哪些是硬中断（或称外中断）？', '{\"A\":\"计时器\",\"B\":\"除数为0\",\"C\":\"电源故障\",\"D\":\"运算溢出\"}', 'AC');
INSERT INTO `co_test_problem` VALUES (255, 2, '以下哪些是软中断（或称内中断）？', '{\"A\":\"设备故障\",\"B\":\"运算溢出\",\"C\":\"除数为0\",\"D\":\"程序运行至断点处\"}', 'BCD');
INSERT INTO `co_test_problem` VALUES (256, 2, '以下哪些是软中断（或称内中断）？', '{\"A\":\"除数为0\",\"B\":\"校验线路\",\"C\":\"电源故障\",\"D\":\"指令中断\"}', 'AD');
INSERT INTO `co_test_problem` VALUES (257, 2, '以下哪些是软中断（或称内中断）？', '{\"A\":\"运算溢出\",\"B\":\"程序运行至断点处\",\"C\":\"实时时钟\",\"D\":\"计时器\"}', 'AB');
INSERT INTO `co_test_problem` VALUES (258, 1, '以下哪些是硬中断（或称外中断）？', '{\"A\":\"指令中断\",\"B\":\"除数为0\",\"C\":\"指令单步运行\",\"D\":\"实时时钟\"}', 'D');
INSERT INTO `co_test_problem` VALUES (259, 2, '以下哪些是软中断（或称内中断）？', '{\"A\":\"指令中断\",\"B\":\"除数为0\",\"C\":\"指令单步运行\",\"D\":\"实时时钟\"}', 'ABC');
INSERT INTO `co_test_problem` VALUES (260, 2, '由CPU内部的指令或程序执行中的突发事件所引起的中断称为：', '{\"A\":\"硬中断\",\"B\":\"软中断\",\"C\":\"异常\",\"D\":\"内中断\"}', 'BCD');
INSERT INTO `co_test_problem` VALUES (261, 2, '程序取数失败引起的异常属于', '{\"A\":\"硬中断\",\"B\":\"软中断\",\"C\":\"外中断\",\"D\":\"内中断\"}', 'BD');
INSERT INTO `co_test_problem` VALUES (262, 1, '在很多中断系统中，对所有的中断源编码，为其分配唯一的代号，称为：', '{\"A\":\"中断源号\",\"B\":\"异常源号\",\"C\":\"中断类型号\",\"D\":\"中断分类号\"}', 'C');
INSERT INTO `co_test_problem` VALUES (263, 1, '80X86有256种中断类型，对应中断类型号应为几位？', '{\"A\":\"4\",\"B\":\"8\",\"C\":\"16\",\"D\":\"256\"}', 'B');
INSERT INTO `co_test_problem` VALUES (264, 2, '中断类型号的用途是什么？', '{\"A\":\"寻找中断向量\",\"B\":\"寻找中断源\",\"C\":\"寻找中断服务程序入口地址\",\"D\":\"寻找中断向量表\"}', 'AC');
INSERT INTO `co_test_problem` VALUES (265, 1, '中断全过程包含几个阶段？', '{\"A\":\"2\",\"B\":\"3\",\"C\":\"4\",\"D\":\"6\"}', 'C');
INSERT INTO `co_test_problem` VALUES (266, 2, '以下哪些阶段属于中断的过程', '{\"A\":\"中断请求\",\"B\":\"中断响应\",\"C\":\"中断服务\",\"D\":\"中断返回\"}', 'ABCD');
INSERT INTO `co_test_problem` VALUES (267, 1, 'CPU判断是否有中断发生，这个判断属于中断过程的4个阶段', '{\"A\":\"对\",\"B\":\"错\",\"C\":\"\",\"D\":\"\"}', 'A');
INSERT INTO `co_test_problem` VALUES (268, 1, '外设或其他中断源通过CPU的中断请求引脚向CPU发送中断请求信号,CPU在每条指令执行完后，检测是否有中断请求，这个阶段称为', '{\"A\":\"中断请求\",\"B\":\"中断响应\",\"C\":\"中断服务\",\"D\":\"中断返回\"}', 'A');
INSERT INTO `co_test_problem` VALUES (269, 1, 'CPU在每条指令执行完后，检测是否有中断请求，若有，则转入', '{\"A\":\"中断请求\",\"B\":\"中断响应\",\"C\":\"中断服务\",\"D\":\"中断返回\"}', 'B');
INSERT INTO `co_test_problem` VALUES (270, 1, '对于那些CPU目前不准备响应的中断源，采取什么方法实现“不响应”？', '{\"A\":\"关中断\",\"B\":\"开中断\",\"C\":\"中断屏蔽\",\"D\":\"优先级判断\"}', 'C');
INSERT INTO `co_test_problem` VALUES (271, 1, 'CPU目前不准备响应任何中断源，采取什么方法实现“不响应”？', '{\"A\":\"关中断\",\"B\":\"开中断\",\"C\":\"中断屏蔽\",\"D\":\"优先级判断\"}', 'A');
INSERT INTO `co_test_problem` VALUES (272, 2, '中断响应阶段，CPU首先应该', '{\"A\":\"关中断\",\"B\":\"保存断点地址\",\"C\":\"转入中断服务程序入口地址\",\"D\":\"保存标志寄存器\"}', 'BD');
INSERT INTO `co_test_problem` VALUES (273, 1, '中断响应阶段，CPU首先通过硬件保存程序断点地址（PC）和标志寄存器，以便中断返回，由于该过程对软件设计者是透明的，因此又称为', '{\"A\":\"黑盒\",\"B\":\"盲区\",\"C\":\"中断隐指令\",\"D\":\"中断初始化程序\"}', 'C');
INSERT INTO `co_test_problem` VALUES (274, 1, '中断向量又称为', '{\"A\":\"中断隐指令\",\"B\":\"中断初始化程序\",\"C\":\"断点地址\",\"D\":\"中断服务程序入口地址\"}', 'D');
INSERT INTO `co_test_problem` VALUES (275, 1, 'CPU在执行某个中断服务程序的过程中，又出现新的中断请求，CPU打断当前正在执行的中断服务程序，而去响应新的中断请求，称为', '{\"A\":\"中断返回\",\"B\":\"中断响应\",\"C\":\"中断嵌套\",\"D\":\"中断服务\"}', 'C');
INSERT INTO `co_test_problem` VALUES (276, 1, '中断返回解决的问题是', '{\"A\":\"解决外设的服务请求\",\"B\":\"转回主程序\",\"C\":\"恢复断点地址和中断处理之前的标志位\",\"D\":\"通知CPU结束中断处理\"}', 'C');
INSERT INTO `co_test_problem` VALUES (277, 1, '中断返回时，从哪里找出断点地址写入程序计数器PC?', '{\"A\":\"堆栈\",\"B\":\"通用寄存器\",\"C\":\"标志寄存器\",\"D\":\"多功能运算器\"}', 'A');
INSERT INTO `co_test_problem` VALUES (278, 2, '中断的作用有：', '{\"A\":\"实现CPU与多台I/O设备并行工作\",\"B\":\"执行程序功能\",\"C\":\"使CPU具有处理应急事件的能力\",\"D\":\"能够进行实时处理\"}', 'ACD');
INSERT INTO `co_test_problem` VALUES (279, 2, '中断的作用有：', '{\"A\":\"实现人机通信\",\"B\":\"实现多道程序运行和分时操作\",\"C\":\"实现应用程序和操作系统的联系\",\"D\":\"实现多机系统中各处理机间的联系\"}', 'ABCD');
INSERT INTO `co_test_problem` VALUES (280, 1, '如果同一时刻有多个中断源向CPU申请中断，CPU按照某规则选择一个进行处理，这是', '{\"A\":\"中断响应\",\"B\":\"中断优先级\",\"C\":\"中断屏蔽\",\"D\":\"中断嵌套\"}', 'B');
INSERT INTO `co_test_problem` VALUES (281, 2, '子程序调用的条件是', '{\"A\":\"用指令实现调用\",\"B\":\"只能在程序中指定的位置调用\",\"C\":\"预定调用\",\"D\":\"子程序调用是一种程序转移\"}', 'ABCD');
INSERT INTO `co_test_problem` VALUES (282, 2, '中断和子程序调用对比', '{\"A\":\"中断的触发是随机的，子程序调用是预定调用\",\"B\":\"都只能在程序中指定的位置调用\",\"C\":\"中断是一种特殊的子程序调用\",\"D\":\"中断触发不需要指令，子程序需要用指令来调用\"}', 'ACD');
INSERT INTO `co_test_problem` VALUES (283, 2, '中断和子程序调用对比', '{\"A\":\"中断的触发是随机的，子程序调用是预定调用\",\"B\":\"中断返回和子程序返回都需要指令来实现\",\"C\":\"中断返回和子程序返回都是程序转移\",\"D\":\"都需要用指令来调用\"}', 'ABC');
INSERT INTO `co_test_problem` VALUES (284, 1, '子程序返回时，从哪里找出返回地址写入程序计数器PC?', '{\"A\":\"通用寄存器\",\"B\":\"标志寄存器\",\"C\":\"多功能运算器\",\"D\":\"堆栈\"}', 'D');
INSERT INTO `co_test_problem` VALUES (285, 1, '在Yy-Z02模型机仿真软件上，外设怎样提起中断请求？', '{\"A\":\"通过Int_r\",\"B\":\"通过Input\",\"C\":\"通过INT按钮\",\"D\":\"以上都不对\"}', 'C');
INSERT INTO `co_test_problem` VALUES (286, 1, '在Yy-Z02模型机仿真软件上，中断向量是如何得到的？', '{\"A\":\"通过Int_r输入\",\"B\":\"通过Input输入\",\"C\":\"通过INT按钮得到\",\"D\":\"程序内置\"}', 'A');
INSERT INTO `co_test_problem` VALUES (287, 2, '在Yy-Z02模型机仿真软件上，点击INT按钮提起中断请求前，如果没有在Int_r框中输入中断向量，会发生什么情况？', '{\"A\":\"中断响应时，程序跑飞\",\"B\":\"不响应中断\",\"C\":\"无法转入中断服务程序\",\"D\":\"无法中断返回\"}', 'AC');
INSERT INTO `co_test_problem` VALUES (288, 1, '在Yy-Z02模型机仿真软件上，如果打开文件<中断功能的模型机设计与实现.yyy>，但是没有下装，执行程序的时候会怎样？', '{\"A\":\"无法执行程序\",\"B\":\"正常执行程序\",\"C\":\"内存窗口里可以看到程序\",\"D\":\"执行程序前，需要先总清clr\"}', 'A');
INSERT INTO `co_test_problem` VALUES (289, 1, '在Yy-Z02模型机仿真软件上，总清以后，程序总是从哪个地址开始执行？', '{\"A\":\"0\",\"B\":\"0FFH\",\"C\":\"0DH\",\"D\":\"以上都不对\"}', 'A');
INSERT INTO `co_test_problem` VALUES (290, 1, '在Yy-Z02模型机仿真软件上，用Int_r输入中断向量时', '{\"A\":\"中断向量值随意定\",\"B\":\"无论怎样改动程序，中断向量与硬件有关，永远只能为0DH\",\"C\":\"必须与内存中中断服务程序的第一条指令地址一致\",\"D\":\"以上都不对\"}', 'C');
INSERT INTO `co_test_problem` VALUES (291, 1, '在Yy-Z02模型机仿真软件上，如果打开内存窗口，把中断服务程序从原来0DH开始的地址，整体搬迁到起始地址为70H的一段空间，CPU总是从0地址开始执行程序，那么 用Int_r输入中断向量时，应输入', '{\"A\":\"0\",\"B\":\"0DH\",\"C\":\"70H\",\"D\":\"条件不足，无法判断\"}', 'C');
INSERT INTO `co_test_problem` VALUES (292, 1, '在Yy-Z02模型机仿真软件上，如果打开内存窗口，把子程序从原来17H开始的地址，整体搬迁到起始地址为70H的一段空间，CPU总是从0地址开始执行程序，那么 用Int_r输入中断向量时，应输入', '{\"A\":\"0\",\"B\":\"0DH\",\"C\":\"70H\",\"D\":\"条件不足，无法判断\"}', 'D');
INSERT INTO `co_test_problem` VALUES (293, 1, '计算机里跳转指令的寻址方式是', '{\"A\":\"直接寻址\",\"B\":\"间接寻址\",\"C\":\"相对寻址\",\"D\":\"以上都不对\"}', 'C');
INSERT INTO `co_test_problem` VALUES (294, 1, '在Yy-Z02模型机仿真软件上，CPU总是从0地址开始执行程序，CALL指令采用直接寻址，如果打开内存窗口，把子程序从原来17H开始的地址，整体搬迁到起始地址为70H的一段空间，那么应该做哪些改变才能够正确实现子程序调用？', '{\"A\":\"修改堆栈指针\",\"B\":\"修改PC值为70H\",\"C\":\"修改CALL指令地址\",\"D\":\"修改CALL指令中跳转直接地址为70H\"}', 'D');
INSERT INTO `co_test_problem` VALUES (295, 1, '在Yy-Z02模型机仿真软件上，执行文件<中断功能的模型机设计与实现.yyy>时，中断触发只能发生在HLT指令处', '{\"A\":\"对\",\"B\":\"错\",\"C\":\"\",\"D\":\"\"}', 'B');
INSERT INTO `co_test_problem` VALUES (296, 1, '在Yy-Z02模型机仿真软件上执行文件<中断功能的模型机设计与实现.yyy>时，在ADD指令执行期间点击了INT按钮，CPU却在指令结束时并不理睬外设的中断请求，原因可能是：', '{\"A\":\"ADD指令屏蔽了中断\",\"B\":\"处于关中断状态\",\"C\":\"发生了中断屏蔽\",\"D\":\"以上都不对\"}', 'B');
INSERT INTO `co_test_problem` VALUES (297, 1, 'CLI指令是', '{\"A\":\"开中断指令\",\"B\":\"关中断指令\",\"C\":\"中断返回指令\",\"D\":\"以上都不对\"}', 'B');
INSERT INTO `co_test_problem` VALUES (298, 1, 'STI指令是', '{\"A\":\"开中断指令\",\"B\":\"关中断指令\",\"C\":\"中断返回指令\",\"D\":\"以上都不对\"}', 'A');
INSERT INTO `co_test_problem` VALUES (299, 1, 'IRET指令是', '{\"A\":\"开中断指令\",\"B\":\"关中断指令\",\"C\":\"中断返回指令\",\"D\":\"子程序返回指令\"}', 'C');
INSERT INTO `co_test_problem` VALUES (300, 1, 'CALL指令是', '{\"A\":\"开中断指令\",\"B\":\"关中断指令\",\"C\":\"中断返回指令\",\"D\":\"子程序调用指令\"}', 'D');
INSERT INTO `co_test_problem` VALUES (301, 1, 'RET指令是', '{\"A\":\"中断调用指令\",\"B\":\"子程序调用指令\",\"C\":\"中断返回指令\",\"D\":\"子程序返回指令\"}', 'D');
INSERT INTO `co_test_problem` VALUES (302, 1, '关于IRET和RET指令', '{\"A\":\"前者是中断返回指令，后者是子程序返回指令\",\"B\":\"前者是子程序返回指令，后者是中断返回指令\",\"C\":\"两条指令都可用于子程序返回\",\"D\":\"两条指令都可用于中断返回\"}', 'A');
